INSERT INTO `tbl_barangaycasesmanagement_announcements` (`primary_key`, `date_and_time`, `title`, `body`) VALUES
(1, '2023-09-27 13:27:51', 'Barangay Family Fun Day', 'Dear Barangay Residents,\r\n\r\nWe are excited to invite you to our upcoming Barangay Family Fun Day on September 30, 2023 at Barangay Plaza. This event promises to be a day of fun, games, and community bonding. We have activities for all ages, delicious food stalls, and live entertainment. Please mark your calendars and join us for a day of celebration and unity. See you there!\r\n\r\nBest regards,\r\nJuan Dela Cruz\r\nBarangay Captain'),
(2, '2023-09-27 13:30:00', 'Barangay Cleanup Day', 'Hello Barangay Neighbors,\r\n\r\nWe are organizing a Barangay Cleanup Day on October 1, 2023 to ensure our community remains clean and beautiful. We need your help to make this event a success. Please come prepared with gloves and trash bags. We will meet at Barangay Hall at 3:00 PM. Let\'s work together to keep our barangay clean and green!\r\n\r\nSincerely,\r\nSofia Santos\r\nBarangay Environmental Officer'),
(3, '2023-09-27 13:32:00', 'Emergency Preparedness Meeting', 'Dear Barangay Residents,\r\n\r\nIn light of recent events, we are holding an Emergency Preparedness Meeting on October 15, 2023 at Barangay Plaza at 8:00 AM. We will discuss disaster response plans, evacuation routes, and emergency contacts. Your safety is our priority, so please make an effort to attend and stay informed.\r\n\r\nStay safe,\r\nRosa Lim\r\nBarangay Livelihood and Cooperative Officer'),
(4, '2023-09-27 13:34:52', 'Registration for our Youth Sports League', 'Hey Barangay Youth,\r\n\r\nAre you ready to showcase your athletic talents? Registration for our Youth Sports League is now open! We have various sports to choose from, including basketball, soccer, and volleyball. To register, visit the barangay office from September 25, 2023 - September 30, 2023 with a copy of your birth certificate. Let\'s show our sportsmanship and teamwork on the field!\r\n\r\nPlay on,\r\nMiguel Ramirez\r\nBarangay Youth Council Chairperson'),
(5, '2023-09-27 13:36:57', 'Free Health Checkup Camp', 'Dear Residents,\r\n\r\nWe care about your health! We are conducting a free Health Checkup Camp on September 30, 2023 at Barangay Plaza from 7:00 AM. This includes blood pressure checks, glucose level tests, and general health consultations. Don\'t miss this opportunity to prioritize your well-being. See you there!\r\n\r\nTake care,\r\nLuisa Reyes\r\nBarangay Health Worker'),
(6, '2023-10-10 13:27:17', 'Walang Pasok Due Volcanic Eruption', 'Kanselado ang klase sa ating pampubliko at pribadong paaralan in all levels (PM session),  sa kadahilanan na may maaaring masamang epekto ang volcanic smog o vog na ibinubuga ng Bulkang Taal.\r\nPinapayuhan ang lahat na magsuot ng face masks at manatili sa loob ng inyong mga tahanan. Modular Distance Learning shall be implemented in accordance to DepEd Order No. 37 series of 2023.'),
(7, '2023-11-20 20:31:55', 'Committee of the Whole', 'Pinangunahan po natin ang pagpupulong ng kumite ng pangkalahatan kasama ang mga miyembro ng Sangguniang Bayan at mga Department heads. \r\nAgenda : \r\nKahilingan na magpatibay ng kautusan na matugunan ang mga pangangailangan ng various sectors gaya ng: \r\n-Grant of gratuity pay to contract of service and job orders workers\r\n-Cash assistance to retired public elementary and secondary school teachers.\r\nVenue: SB Session Hall \r\nMga Dumalo: \r\nHon. Ralp Ivan A. Rodriguez\r\nHon. Mark Anthony C. Marcelo (Representative)\r\nHon. Mario Roderick C. Lazarte\r\nHon. Maria Carmela V. Javier, M.D., DPPS, MHA\r\nHon. Mark David C. Acob\r\nHon. Arnel M. De Vera\r\nHon. Virgilio D. Vertudez\r\nMs. Lilibeth Vicente-Delgra - SB Secretary\r\nAtty. Remigio N. Manahan Jr. - Municipal Admin\r\nAtty. Charly T. Ricafort - SB Session Legal Consultant\r\nNoel A. Brotonel - OIC HRMO\r\nMary Grace Lumagut - Budget Office\r\nMarinel Balugot - Budget Office\r\nLeoncio I. Orga - OIC Accounting \r\nClifford Sexon - OIC Budget Office\r\nGemma C. Cruz - Municipal Treasurer\r\nDr. Luzviminda G. Moyano - OIC MEDO\r\nAna Cristi S. Pangilinan - SH - TES\r\nOdes M. Dagong - SH Magalipit ES\r\n#EqualServices\r\n#PantaynaSerbisyosaBayan #MalasakitSaBayan \r\n#VMUmpekSison'),
(8, '2023-12-02 12:39:38', 'Memoramdum Circular No.006 S.2023,', 'Alinsunod sa atas ng NDRRMC Memoramdum Circular No.006 S.2023, Ang Pag papanumbalik ng FACE-TO-FACE Conduct of National Simultaneous Earth Quake Drill, Pinangunahan ng tanggapan ng Montalban MDRRMO ang katuparan nito.\r\nBilang pagtalima sa nasabi ng kautusan, matagumpay na isinagawa ito sa Land Transportation Office Extension Office (LTO) at Bureau Jail Management and Penology (BJMP Rodriguez), kapwa nasa Barangay San Jose, Rodriguez, Rizal\r\n#DuckCoverAndHold\r\n#NSED2023\r\nSa oras ng pangangailangan, maaaring tumawag sa ating numero:\r\n0969-614-4825\r\n24/7 Operation\r\n#BangonBagongMontalban\r\n#LigtasatMatatagnaMontalban'),
(9, '2023-12-17 01:09:02', 'test', 'testing 123'),
(10, '2023-12-22 02:34:45', 'PAMAMAHAGI NG ASSISTIVE DEVICES ', 'Serbisyong pantay ang isinusulong ng pamahalaang lokal, sa paglilingkod ni Punongbayan Ronnie S. Evangelista, para sa lahat ng residente ng Montalban.\r\nGaya na lamang ng pamamahagi ng Assistive Devices (Wheelchair at Walking Stick) para sa mga Montalbeñong Indigent na kabilang din sa sektor ng Person with Disabilities (PWDs).\r\nIsinagawa ang paghahandog ng nasabing devices sa Office of the Municipal Mayor (OMM). Kumatawan naman si Ms. Tina Siuagan para kay Punongbayan Ronnie S. Evangelista upang mamahagi.\r\nTuloy-tuloy naman ang mga serbisyong isinusulong ng pamahalaan para sa lahat.\r\n#WheelChair #WalkingStick\r\n#BagongMontalban\r\n'),
(11, '2023-12-22 14:38:07', 'test', 'testing');

