INSERT INTO `tbl_barangaycasesmanagement_barangaynews` (`primary_key`, `date`, `time`, `title`, `body`, `image`) VALUES
(1, '2023-10-16', '22:42:47', 'Achieves Record-Breaking Tree Planting Milestone', 'In a remarkable display of community unity and environmental stewardship, our barangay residents came together to plant a record-breaking 1,000 trees in a single day. The tree planting event, held at [Location], aimed at enhancing our green spaces and combating climate change. Barangay Captain [Name] expressed gratitude to all participants and emphasized the importance of preserving our environment for future generations.', '652d4be7130b1_1697467367.jpg'),
(2, '2023-10-16', '22:41:34', 'Health Center Offers Free COVID-19 Vaccination', 'The barangay health center is now offering free COVID-19 vaccinations to all eligible residents aged 12 and above. The vaccination drive, part of the nationwide effort to combat the pandemic, aims to protect our community and return to a sense of normalcy. Residents are encouraged to schedule their appointments at the health center and do their part to fight the virus.', '652d4b9e4f656_1697467294.jpg'),
(3, '2023-10-16', '22:40:36', 'Youth Basketball Team Wins Championship', 'Our barangay\'s youth basketball team, the [Team Name], secured a well-deserved victory in the regional championships. The team\'s hard work, dedication, and exceptional teamwork led them to clinch the title. Congratulations to our young athletes for their impressive achievement, and we look forward to more successes in the future!', '652d4b64dbe62_1697467236.jpg'),
(4, '2023-10-16', '22:39:51', 'Launches Disaster Preparedness Campaign', 'In preparation for potential natural disasters, our barangay has initiated a comprehensive disaster preparedness campaign. The campaign includes workshops, drills, and the distribution of emergency kits to households. Barangay Disaster Preparedness Coordinator [Name] stressed the importance of being ready for any emergency and encouraged all residents to participate in the program.', '652d4b37754b8_1697467191.jpg'),
(5, '2023-10-16', '22:38:45', 'Barangay Celebrates Annual Cultural Festival', 'The vibrant colors and rich culture of our barangay were on full display during the annual Cultural Festival held at [Location]. Residents showcased traditional dances, music, and cuisine, highlighting the diversity that makes our community unique. The event was a testament to the unity and pride shared by our residents.', '652d4af510dbe_1697467125.jpg'),
(6, '2023-11-20', '20:30:42', 'January 04, 2023 ', 'Ang Montalban MDRRMO Medic Team, Tow Truck Team, Barangay San Jose at Barangay San Isidro ay agad na rumesponde sa nangyaring Road Crash na nangyari sa bahagi ng Jeafer Harangan San Isidro at agad naman nilapatan ng paunang lunas ang mga pasyente at dinala sa pinakamalapit na ospital.\r\nRESPONDING PERSONNEL:\r\nOperation&Warning Officer:Aderito Dela Cruz\r\nTeam Leader: R.Anastacio/R.Brioso\r\nCrew: R.Maceda/M.Camillet/J.Marquez/G.Indong\r\nE.Togado/C.Cerbo/M.Virgines/V.Perez\r\nPilot: F.Riduca/R.Antona/W.Perez\r\nSa oras ng kagipitan, maaaring tumawag sa ating mga numero:\r\n0969-614-4825\r\n0915-001-6988\r\n24/7 Operation\r\n#BangonBagongMontalban\r\n#TatakEvangelista\r\n#QuickResponseTeam \r\n#ActionAgad', '655b51725939e_1700483442.png'),
